import { Button, Card } from "react-bootstrap";

import { Link } from "react-router-dom";
import React from "react";
import Spinner from "SharedComponents/Spinner";

function StepWalletDownload({ isFetching }) {
  return (
    <Card>
      <Card.Body>
        <Card.Title>The Password is Saved</Card.Title>
        <div className="text-center mt-5">
          <span className="d-block">You can download your backup file</span>
          <Button className="mt-5 mb-2">Download</Button>
          <Link to="/wallet" className="d-block mb-5">
            <small>Back to your wallets</small>
          </Link>
          <span className="d-block">Make sure to save it somewhere</span>
        </div>
      </Card.Body>
      {isFetching ? <Spinner/> : null}
    </Card>
  );
}

export default StepWalletDownload;
